css:
@-moz-document domain("pytorch.org") {
/**** Tutorials - https://pytorch.org/tutorials *****/

/*** Main Page ***/

body {
  background-color: #282828;
  color: #ccc;
}

/*** Top Header ***/
.header-holder {
  background-color: #282828;
  border-bottom-color: #666;
}

/* Options */
.tutorials-header .main-menu ul li a {
  color: #ccc;
}

/*** Left Menu ***/
.pytorch-left-menu {
  background-color: #282828; /* rgb(52, 49, 49); */
}

/* Search */
.pytorch-left-menu-search input[type="text"] {
  background-color: #333;
  border-color: #333;
  color: #eee;
}

/* Links */
.pytorch-left-menu a:link, .pytorch-left-menu a:visited, .pytorch-left-menu a:hover, .pytorch-right-menu a:link, .pytorch-right-menu a:visited, .pytorch-right-menu a:hover {
  color: #ddd;
}

span.caption-text {
  color: #eee;
}

/*** Right Menu ***/
.pytorch-content-wrap {
  background-color: #282828;
}

/* Top bar */
.pytorch-page-level-bar {
  background-color: #282828;
  border-bottom-color: #666;
}

/* Text */
article.pytorch-article p, article.pytorch-article ul li, article.pytorch-article ol li, article.pytorch-article dl dt, article.pytorch-article dl dd, article.pytorch-article blockquote {
  color: #ccc;
}

/** Sub-section Headings **/
article.pytorch-article h2, article.pytorch-article h3, article.pytorch-article h4, article.pytorch-article h5, article.pytorch-article h6 {
  color: #ccc;
}

/*** Tutorial Page ***/

/** Right Side Text **/

article.pytorch-article h1 a, 
article.pytorch-article h2 a, 
article.pytorch-article h3 a, 
article.pytorch-article h4 a, 
article.pytorch-article h5 a, 
article.pytorch-article h6 a {
  color: #ccc;
}

/** Code **/
pre {
  background-color: #1c1c1c;
}

.pytorch-article div.sphx-glr-script-out .highlight pre {
  background-color: #222;
  color: #ccc;
}

/** 'Note:' **/
article.pytorch-article .note, article.pytorch-article .warning {
  background-color: #222;
}

article.pytorch-article .note p:nth-child(n+2), article.pytorch-article .warning p:nth-child(n+2) {
  color: #ddd;
}

/* inline Code */
article.pytorch-article .note .pre, article.pytorch-article .note pre, article.pytorch-article .warning .pre, article.pytorch-article .warning pre {
  background-color: #1c1c1c;
  outline-color: #1c1c1c;
}

article.pytorch-article .section :not(dt) > code {
  background-color: #1c1c1c;
  border-top-color: #1c1c1c;
  border-bottom-color: #1c1c1c;
}

span.pre {
  color: #F05732;
  background-color: #1c1c1c;
}

/** Syntax highlighting **/

pre {
  color: #ccc;
}

.highlight .nn {
  color: #ccc;
}

.highlight .o {
  color: #ccc;
}

/* Class */
.highlight .nc {
  color: #7aac18; /* #a6e22e; */
}

/* 'import' */
.highlight .kn {
  color: #007020;
}

/* 'print' function */
.highlight .k {
  color: #cd064d; /* #b80545; */
}

.highlight .kv {
  color: #cd064d;
}

/* 'in' */
.highlight .ow {
  color: #cd064d;
}

/* function */
.highlight .nf, .fm {
  color: #1aa2bb;
}

/* string, character */
.highlight .sd {
  color: #666;
}

.highlight .s1, .highlight .s2 {
  color: #080; /* #fe9; */
}

/* Self */
.highlight .bp {
  color: #FF80F4;
}

/* Types, 'len', 'isinstance' */
.highlight .nb {
  color: #00bfff;
}

/* True, False */
.highlight .kc {
  color: #ce7002;
}

/* Numerals */
.highlight .mi, .highlight .mf {
  color: #AE81FF;
}

/* Comments */
.highlight .c1 {
  color: #666;
}

/** Boxed below **/

.sphx-glr-thumbcontainer {
  background-color: #333;
}

article.pytorch-article .sphx-glr-thumbcontainer {
  border-color: #666;
}

article.pytorch-article .sphx-glr-thumbcontainer:hover {
  border-bottom-color: #666;
}

article.pytorch-article .sphx-glr-thumbcontainer::after {
  background-color: #666;
}

article.pytorch-article .sphx-glr-thumbcontainer .figure::before {
  background-color: #282828;
  opacity: 0.0;
}

article.pytorch-article .sphx-glr-thumbcontainer .caption-text a {
  color: #ccc;
}

/* Image */
.sphx-glr-thumbcontainer img {
  filter: invert(80%);
}

/** 'Download Python Source', 'Download Jupyter Notebook' **/

.pytorch-article div.sphx-glr-download a {
  background-color: #333;
}

.pytorch-article div.sphx-glr-download a:hover {
  background-color: #484848;
}

article.pytorch-article .function code, article.pytorch-article .attribute code, article.pytorch-article .class .attribute code, article.pytorch-article .class code {
  color: #ccc;
}

.pytorch-article div.sphx-glr-download a span.pre {
  color: #ccc;
}

/*** Search Results - pytorch.org/tutorials/search.html?q=? ***/

.rst-content .highlighted {
  background-color: #444;
}

/*** Docs - pytorch.org/docs e.g. pytorch.org/docs/stable/tensors.html ***/

/* Table */

article.pytorch-article table th {
  color: #aaa;
}

article.pytorch-article .wy-table-responsive table tbody td .pre {
  background-color: #333;
  outline-color: #333;
}

article.pytorch-article .wy-table-responsive table tbody .row-odd {
  background-color: #282828;
}

article.pytorch-article .wy-table-responsive table tbody td {
  color: #999;
}


/* Code */
article.pytorch-article .function dt, article.pytorch-article .class dt, article.pytorch-article .attribute dt, article.pytorch-article .class .attribute dt {
  background-color: #333;
}

article.pytorch-article .function dt > code, article.pytorch-article .class dt > code, article.pytorch-article .attribute dt > code, article.pytorch-article .class .attribute dt > code {
  color: #ccc;
  background-color: #333;
  border-top-color: #333;
  border-bottom-color: #333;
}

/* Text */
article.pytorch-article .function dd p, article.pytorch-article .class dd p, article.pytorch-article .attribute dd p, article.pytorch-article .class .attribute dd p {
  color: #ccc;
}

article.pytorch-article .function table tbody tr td.field-body, article.pytorch-article .class table tbody tr td.field-body, article.pytorch-article .attribute table tbody tr td.field-body {
  color: #ccc;
}

article.pytorch-article .function table tbody tr th.field-name, article.pytorch-article .class table tbody tr th.field-name, article.pytorch-article .attribute table tbody tr th.field-name {
  color: #ccc;
}

/* Text - Math expressions */
article.pytorch-article .math {
  color: #ccc;
}

/** 'Warning' **/
article.pytorch-article .warning .admonition-title {
  background-color: #532222; /* #e94f3b; */
}

article.pytorch-article .note p:nth-child(n+2), article.pytorch-article .warning p:nth-child(n+2) {
  color: #ccc;
}

/* small white box */
article.pytorch-article .admonition .last code {
  background-color: #1c1c1c;
  border-top-color: #1c1c1c;
  border-bottom-color: #1c1c1c;
  outline-color: #1c1c1c;
}

article.pytorch-article .note .first, article.pytorch-article .warning .first, article.pytorch-article .tip .first, article.pytorch-article .hint .first, article.pytorch-article .important .first, article.pytorch-article .caution .first, article.pytorch-article .danger .first, article.pytorch-article .attention .first, article.pytorch-article .error .first {
  color: #ccc;
}

/** 'Note' **/
article.pytorch-article .note .admonition-title {
  background-color: #183a44; /* #54c7ec; */
}

/*** Resources - pytorch.org/resources ***/


/* Top header */
.header-holder.blog-header, .header-holder.blog-detail-header, .header-holder.resources-header, .header-holder.get-started-header, .header-holder.features-header, .header-holder.ecosystem-header {
  background-color: #282828;
  border-bottom-color: #666;
}

.blog-header .main-menu ul li a, .blog-detail-header .main-menu ul li a, .resources-header .main-menu ul li a, .get-started-header .main-menu ul li a, .features-header .main-menu ul li a, .ecosystem-header .main-menu ul li a {
  color: #ccc;
}

/** Boxes **/

.resource-card {
  border-color: #666;
}

.ecosystem-card h4, .resource-card h4 {
  color: #aaa;
}

.ecosystem-card:hover p.card-summary, .resource-card:hover p.card-summary {
  color: #aaa;
}


/*** Get Started - pytorch.org/get-started/locally ***/

/** 'Start Locally' Box **/
.get-started .quick-start-module {
  background-color: #282828;
}

/* Specifications Boxes */
.get-started .quick-start-module .title-block {
  border-color: #282828;
}

.get-started .quick-start-module .option, .get-started .quick-start-module #command {
  background-color: #333;
  border-color: #282828;
  color: #aaa;
}

.get-started .quick-start-module .selected {
  background-color: #ee4c2c; /* keeping same */
  color: #ccc;
}

.quick-starts .option:hover {
  background-color: #ee4c2c; /* keeping same */
  color: #ccc;
}

/* Code */
.quick-starts .command-container pre {
  background-color: #333;
}

/** Blockquotes **/

article.pytorch-article blockquote {
  background-color: #333;
  border-left-color: #666;
}

code.highlighter-rouge {
  background-color: #333;
  color: #aaa;
}

/* Code block */
pre.highlight {
  background-color: #222;
}

.highlight .nt {
  color: #4b83d9;
}


/*** Features - pytorch.org/features ***/

/* Code blocks */
.highlight .err {
  background-color: #222;
}

/* Text */
.features-row p {
  color: #aaa;
}

/** 'Quick Start Locally' block **/
.quick-starts {
  background-color: #333;
}

.quick-start-module p {
  color: #aaa;
}

/* Specifications Boxes */

.quick-starts .title-block {
  border-color: #333;
}

.quick-starts .option {
  background-color: #444;
  border-color: #333;
  color: #aaa;
}

.quick-starts .selected {
  background-color: #ee4c2c;
  color: #ccc;
}

.quick-starts #command {
  background-color: #282828;
  border-color: #333;
}

.quick-starts .start-locally-col pre {
  background-color: #282828 !important;
}

/** 'Quick Start With Cloud Partners' on right */

.quick-starts .cloud-option {
  background-color: #444;
  border-color: #333;
  color: #aaa;
}
}

@-moz-document domain("discuss.pytorch.org") {
/* Header */
.d-header {
  background-color: #282828;
}

/* Dropdown menu on right */

.drop-down-mode .d-header-icons .active .icon{
  background-color: #282828;
  border-color: #333;
}

.menu-panel{
  background-color: #282828;
  border-color: #333;
}

.menu-panel li a:hover, .menu-panel li a:focus, .menu-panel li.heading a:hover, .menu-panel li.heading a:focus {
  background-color: #333;
}

.d-header-icons .icon:hover, .d-header-icons .icon:focus {
  background-color: #333;
  color: #aaa;
}

hr {
  border-top-color: #333;
}

/** 'All Categories' dropdown **/

.list-controls .combo-box .combo-box-header {
  background-color: #333;
  border-color: #333;
  color: #ccc;
}

.select-kit .select-kit-collection {
  background-color: #282828;
}

.select-kit .select-kit-row.is-highlighted {
  background-color: #333;
}

/* 'Year' */
.select-kit.dropdown-select-box.period-chooser .period-chooser-header h2.selected-name .date-section {
  color: #999;
}

/* Text */
.topic-list-main-link a.title, .topic-list .main-link a.title, .latest-topic-list-item .main-link a.title {
  color: #aaa;
}

/** Table **/

tbody {
  border-top-color: #666;
}

tr {
  border-bottom-color: #666;
}

tr:hover {
  background-color: #333;
}

/** Footer **/
.topic-status-info {
  border-top-color: #666;
}

.btn {
  background-color: #015884;
}

.btn-primary {
  background-color: #08c;
}

/** Alert **/

.alert.alert-info {
  background-color: #00324a;
}

.ember-view {
  color: #08c;
}


/*** FAQ - discuss.pytorch.org/faq ***/

.nav-pills > li > a {
  color: #aaa;
}

/**** Individual Q Page e.g. discuss.pytorch.org/t/problem-in-training-time-of-model/31715 ****/

/* Top Title */
#topic-title h1 a {
  color: #aaa;
}

.topic-body {
  border-top-color: #666;
}

/* Scrolling line on right */
.timeline-container .topic-timeline .timeline-scrollarea {
  border-color: #666;
}

.timeline-container .topic-timeline .timeline-handle {
  background-color: #666;
}

/* Pop-up Pane from Avatar */
#user-card, #group-card {
  background-color: #282828;
  color: #aaa;
}

#user-card .card-content, #group-card .card-content {
  background-color: #282828;
}

#user-card h1 a, #group-card h1 a {
  color: #aaa;
}

#user-card h1 .d-icon, #group-card h1 .d-icon {
  color: #aaa;
}

#user-card .badge-section .user-badge, #user-card .badge-section .more-user-badges, #group-card .badge-section .user-badge, #group-card .badge-section .more-user-badges {
  background-color: #333;
  border-color: #666;
  color: #aaa;
}

/** discuss.pytorch.org/badges/<> **/
.badge-card {
  background-color: #333;
  border-color: #666;
}

.badge-card .badge-contents .badge-info {
  color: #aaa;
}

.btn[href] {
  color: #aaa;
}

/* Notification Icon */
.badge-notification.clicks {
  background-color: #444;
  color: #ccc;
}

/* Avatar Icon */
a.mention, a.mention-group {
  background-color: #333;
  color: #08c;
}


/* Code Snippet */
p > code, li > code, pre > code {
  background-color: #222;
  color: #ccc;
}

.hljs {
  color: #ccc;
}

.hljs-keyword, .javascript .hljs-title, .nginx .hljs-title, .hljs-subst, .hljs-request, .hljs-status {
  color: #aaa;
}

/* Code Snippet within Box */

pre.onebox code {
  background-color: #222;
  color: #ccc;
}

pre.onebox code ol.lines li {
  border-left-color: #333;
}

pre.onebox code li.selected {
  background-color: #333;
}

/* Github Code Snippet */

aside.onebox {
  border-color: #333;
}


/* Question block */

blockquote {
  background-color: #222;
  border-left-color: #333;
}

aside.quote .title {
  background-color: #333;
  border-left-color: #666;
}

/* Text */

.ember-view {
  color: #ccc;
}

/* Replies */

nav.post-controls .show-replies:hover {
  background-color: #333;
  color: #aaa;
}

.embedded-posts {
  border-color: #666;
}

.embedded-posts.bottom .row .topic-avatar, .embedded-posts.bottom .row .topic-body {
  border-top-color: #666;
}

.embedded-posts .collapse-down, .embedded-posts .collapse-up {
  background-color: #282828;
  border-color: #666;
}

.embedded-posts .collapse-down:hover, .embedded-posts .collapse-up:hover {
  background-color: #333;
  color: #aaa;
}

.post-links-container .post-links {
  border-top-color: #666;
}

/* Post Footer */
.topic-map {
  background-color: #333;
  border-color: #666;
}

.topic-map section {
  border-color: #666;
}

.topic-map .buttons .btn {
  background-color: #333;
  color: #aaa;
  border-left-color: #666;
}

.topic-map h3 {
  color: #aaa;
}


/* Note */
.alert.alert-info {
  color: #ccc;
}

/* Link Dynamically-created Pane */
#share-link {
  background-color: #282828;
}

input[type="text"], input[type="password"], input[type="datetime"], input[type="datetime-local"], input[type="date"], input[type="month"], input[type="time"], input[type="week"], input[type="number"], input[type="email"], input[type="url"], input[type="search"], input[type="tel"], input[type="color"] {
  background-color: #333;
  border-color: #666;
  color: #ccc;
}

/* Title on top while scrolling */
.extra-info-wrapper .topic-link {
  color: #aaa;
}

/**** Search Results e.g. discuss.pytorch.org/search?q=<query> ****/

/* Advanced Search box on right */

.search-container .search-advanced-sidebar .search-advanced-filters {
  background-color: #333;
}

div.ac-wrap {
  background-color: #282828;
  border-color: #666;
  color: #aaa;
}

.select-kit.combo-box .select-kit-header {
  background-color: #282828;
  border-color: #666;
}

.search-container .search-advanced-sidebar .search-advanced-title {
  background-color: #333;
}

/* Dropdown Search */
.select-kit .select-kit-body {
  background-color: #282828;
}

.select-kit.combo-box .select-kit-filter {
  border-top-color: #333;
  border-bottom-color: #333;
}

/*  'N+ results for <query>'' */

.search-container .search-advanced .search-info {
  border-bottom-color: #666;
}

/* 'Relevance' dropdown on right */
.select-kit .select-kit-row.is-selected {
  background-color: #333;
}

.select-kit .select-kit-row.is-selected.is-highlighted {
  background-color: #666;
}

/* <query> in result row */
.fps-result .blurb .search-highlight {
  color: #08c;
}
}
